//Quick Access Tray Start
	var scrollTopPosition = 0;
		$(document).ready(function(){
			$("#openQuickAccessTrayFeedback").bind("click",function(){
				OmniNav.callOnlineOpinion();
			});
			$("#openQuickAccessTrayChat").bind("click",function(){
				if($('.live-chat').hasClass( "liveChatEnabled" )){
					console.log("Chat Enabled");
				}
			});
			$( "*" ).click(function( event ) {
				var clickedElementID = event.target.id;
				var initialIconSelected = $('#quickAccessTray .quickAccessTrayClose').hasClass('active');
				if (initialIconSelected == true && clickedElementID.indexOf("quickAccessTray") < 0){
					closeQuickAccessTrayOptions();
				}
			});
			$( window ).scroll(function() {
				var initialIconSelected = $('#quickAccessTray .quickAccessTrayClose').hasClass('active');
				if(initialIconSelected == true){
				  if($(window).scrollTop()- scrollTopPosition > 50 || $(window).scrollTop()- scrollTopPosition < -50){
					closeQuickAccessTrayOptions();
				  }
				}
				else{
				  return;
				}
			});				
		});
		function toggleDisplayHelpText(selectedOption,event,optionToOpen){
			var clickedElementID = event.target.id;
			var targetDiv = $('#'+optionToOpen);
			var quickAccessTrayRegex = /quickAccessTray(.*?)(?:\s|$)/g;
			var matchedElement = quickAccessTrayRegex.exec(clickedElementID);
			var isAnyQATOptionOpened = $('#openQuickAccessTrayForum').hasClass('activeText')||$('#openQuickAccessTrayChat').hasClass('activeText')||$('#openQuickAccessTrayFeedback').hasClass('activeText')||$('#openQuickAccessTrayNetwork').hasClass('activeText');
			var currentQATOpenedOptionName = getOpenedOptionName();
			var isQATOptionOpened = targetDiv.hasClass('activeText'); 
			var qatOpenedOptionName = targetDiv.attr('name');
			if(isQATOptionOpened == false){
				if(isAnyQATOptionOpened == true){
					closeDisplayHelpText(currentQATOpenedOptionName,selectedOption,clickedElementID);
					$('#quickAccessTray'+currentQATOpenedOptionName.attr('name')).css({'background-image': "url('/omni/m/i/quickaccess_tray/"+currentQATOpenedOptionName.attr('name').toLowerCase()+"_45x45.png')"});
				}
				openDisplayHelpText(targetDiv,selectedOption);								
			}else if(isQATOptionOpened == true && (qatOpenedOptionName == matchedElement[1])){
				closeDisplayHelpText(targetDiv,selectedOption,clickedElementID);
			}else{
				openDisplayHelpText(targetDiv,selectedOption);
			}	
		}
		function getOpenedOptionName(){
			var openedOptionName;
			if($('#openQuickAccessTrayForum').hasClass('activeText')){
				openedOptionName = $('#openQuickAccessTrayForum');
			}else if($('#openQuickAccessTrayChat').hasClass('activeText')){
				openedOptionName = $('#openQuickAccessTrayChat');
			}else if($('#openQuickAccessTrayFeedback').hasClass('activeText')){
				openedOptionName = $('#openQuickAccessTrayFeedback');
			}else if($('#openQuickAccessTrayNetwork').hasClass('activeText')){
				openedOptionName = $('#openQuickAccessTrayNetwork');
			}
			return openedOptionName;
		}
		function openDisplayHelpText(targetDiv,selectedOption){
			targetDiv.animate({width: "121px"}, 200);		
			targetDiv.addClass('activeText');
			$('#quickAccessTray'+selectedOption).css({'background-image': "url('/omni/m/i/quickaccess_tray/"+selectedOption.toLowerCase()+"_highlight_45x45.png')"});
			switch (selectedOption) {
				case 'Forum':
					targetDiv.css("bottom","105px");
					targetDiv.attr("href", "https://community.verizonwireless.com/welcome");
					targetDiv.attr("name", "Forum");
					targetDiv.removeClass("live-chat-box-btn");
					targetDiv.css({'background-image': "url('/omni/m/i/quickaccess_tray/forum_14pt.png')"});
					break;
				case 'Chat':
					targetDiv.css("bottom","156px");
					targetDiv.removeAttr("href");
					targetDiv.attr("name", "Chat");
					if($('.live-chat').hasClass( "liveChatEnabled" )){
						targetDiv.css({'background-image': "url('/omni/m/i/quickaccess_tray/chatNow_14pt.png')"});
					}else{
						targetDiv.css({'background-image': "url('/omni/m/i/quickaccess_tray/chat_Unavailable_14pt_Gray.png')"});
					}
					break;
				case 'Feedback':
					targetDiv.css("bottom","208px");
					targetDiv.removeAttr("href");
					targetDiv.attr("name", "Feedback");
					targetDiv.removeClass("live-chat-box-btn");
					targetDiv.css({'background-image': "url('/omni/m/i/quickaccess_tray/feedback_14pt.png')"});
					break;
				case 'Network':
					targetDiv.css("bottom","261px");
					targetDiv.attr("href", "https://www.verizonwireless.com/wcms/consumer/4g-lte.html#our-network-coverage");			
					targetDiv.attr("name", "Network");
					targetDiv.removeClass("live-chat-box-btn");
					targetDiv.css({'background-image': "url('/omni/m/i/quickaccess_tray/coverage_14pt.png')"});
					break;
				default:
					return;
			}
		}
		function closeDisplayHelpText(targetDiv,selectedOption){
			targetDiv.animate({width: "0px"}, 200);
			$('#quickAccessTray'+targetDiv.attr('name')).css({'background-image': "url('/omni/m/i/quickaccess_tray/"+selectedOption.toLowerCase()+"_45x45.png')"});
			targetDiv.removeClass('activeText');
			targetDiv.removeAttr("href");
		}
		function qatSiteCatalystTracking(trackingOption){
		}
		function toggleQuickAccessTrayOptions(){			
			var initialIconSelected = $('#quickAccessTray .quickAccessTrayClose').hasClass('active');
			if(initialIconSelected == true){
				closeQuickAccessTrayOptions();				
			}else if(initialIconSelected == false){
				applyInitialIconsCSS();
				openQuickAccessTrayOptions();
			}
		}
		function openQuickAccessTrayOptions(){
			var docHeight = $( document).height();
			$('body').prepend('<div class="disablingDiv"></div>');
			$('.disablingDiv').css("height",docHeight);
			$('.disablingDiv').css("display","block");			
			$('#quickAccessTray .quickAccessTrayForum').delay(50).slideToggle("fast");
            $('#quickAccessTray .quickAccessTrayChat').delay(100).slideToggle("fast");
            $('#quickAccessTray .quickAccessTrayFeedback').delay(150).slideToggle("fast");
            $('#quickAccessTray .quickAccessTrayNetwork').delay(200).slideToggle("fast");
			$('#quickAccessTray .quickAccessTrayClose').animate({opacity: 0.8}, 'slow', function() {
					$(this).css({'background-image': "url('/omni/m/i/quickaccess_tray/tray_open_45x45.png')"}).animate({opacity: 1});
			});
			$('#quickAccessTray .quickAccessTrayClose').addClass('active');
			$(document).find("div a *").children(':not(#quickAccessTray)').fadeTo("slow", 0.4);
			$(document).find("div a *").children(':not(#quickAccessTray)').css("background-color", "rgba(88,88,88)");
			scrollTopPosition = $(window).scrollTop();		    
		}
		function closeQuickAccessTrayOptions(){
			$('#quickAccessTray .quickAccessTrayForum').delay(200).slideToggle("fast");
			$('#quickAccessTray .quickAccessTrayChat').delay(150).slideToggle("fast");
			$('#quickAccessTray .quickAccessTrayFeedback').delay(100).slideToggle("fast");
			$('#quickAccessTray .quickAccessTrayNetwork').delay(50).slideToggle("fast");
			$('body').css('position',"");		
			$('.disablingDiv').css("display","none");
			$( ".disablingDiv" ).remove();
			$('#openQuickAccessTrayForum').animate({width: "0px"}, 200); 
			$('#openQuickAccessTrayChat').animate({width: "0px"}, 200); 
			$('#openQuickAccessTrayFeedback').animate({width: "0px"}, 200); 
			$('#openQuickAccessTrayNetwork').animate({width: "0px"}, 200); 
			$('#quickAccessTray .quickAccessTrayClose').animate({opacity: 0.8}, 'slow', function() {
					$(this).css({'background-image': "url('/omni/m/i/quickaccess_tray/tray_close_45x45.png')"}).animate({opacity: 1});
			});			
			$('#quickAccessTray .quickAccessTrayClose').removeClass('active');
			$(document).find("div a *").children(':not(#quickAccessTray)').fadeTo("slow", 1);
			$(document).find("div a *").children(':not(#quickAccessTray)').css("background-color", "");
		}
		function applyInitialIconsCSS(){
			$('#quickAccessTrayForum').css({'background-image': "url('/omni/m/i/quickaccess_tray/forum_45x45.png')"});
			$('#quickAccessTrayChat').css({'background-image': "url('/omni/m/i/quickaccess_tray/chat_45x45.png')"});
			$('#quickAccessTrayFeedback').css({'background-image': "url('/omni/m/i/quickaccess_tray/feedback_45x45.png')"});
			$('#quickAccessTrayNetwork').css({'background-image': "url('/omni/m/i/quickaccess_tray/network_45x45.png')"});
		}
